--
-- Create procedure `Proc_Employee_GetPaing`
--
CREATE DEFINER = 'root'@'localhost'
PROCEDURE Proc_Employee_GetPaing (IN v_Offset int, IN v_Limit int, IN v_Sort varchar(100), IN v_Where varchar(1000))
COMMENT 'lấy nhân viên theo tìm kiếm, phân trang lọc'
BEGIN
  -- Author:         PCTUANANH
  -- Created date:  15/09/2022
  -- Description:   Thêm một nhân viên  mới 
  -- Modified by:
  -- Code chạy thử: CALL  `misa.web08.qtkd.pctuananh`.Proc_Employee_GetPaing(0,10,'','')


  --
  -- Kiểm tra nếu tham số đầu vào $Where bị NULL --> giá trị cho $Where = ''
  -- SELECT * FROM employee WHERE '1=1';
  -- Tạo ra bảng tạm `tmp_employee` lưu thông tin nhân viên
  -- Nên sử dụng bảng tạm vì bảng này sẽ không chỉ chứa dữ liệu lấy ra đơn thuần mà còn phục vụ mục đích lọc, sắp xếp, query theo điều kiện,...
  -- Ngoài ra phải lấy dữ liệu theo phân trang và tổng số bản ghi nên việc sử dụng bảng tạm giúp việc truy vấn trở nên dễ dàng hơn
  IF IFNULL(v_Where, '') = '' THEN
    SET v_Where = '1=1';
  END IF;
  -- Kiểm tra nếu tham số đầu vào $Sort bị NULL --> giá trị cho $Sort = ''
  -- SELECT * FROM employee WHERE '1=1' ORDER BY ModifiedDate DESC ;
  IF IFNULL(v_Sort, '') = '' THEN
    SET v_Sort = 'ModifiedDate DESC';
  END IF;
  -- Join hai bảng emlpoyee và department để lấy dữ liệu 
  SET @Sql = 'SELECT  
   e.EmployeeID, e.EmployeeCode, e.EmployeeName,e.DateOfBirth,e.Gender, e.DepartmentID, d.DepartmentName, e.IdentityNumber,e.IdentityIssuedDate,e.IdentityIssuedPlace,e.PositionName,
   e.Address,e.MobilePhoneNumber,e.LandlinePhoneNumber,e.Email,e.AccountBank,e.NameBank,e.BranchBank, e.CreatedDate,e.ModifiedDate,e.ModifiedBy
  FROM employee e 
  INNER JOIN department d
  ON e.DepartmentID = d.DepartmentID';
  IF v_Limit = -1 THEN
    SET @filterQuery = CONCAT(@Sql, ' WHERE ', v_Where, ' ORDER BY ', v_Sort); -- Mặc định truyền -1 => Nếu truyền -1 sẽ lấy toàn bộ bản ghi
  ELSE
    SET @filterQuery = CONCAT(@Sql, ' WHERE ', v_Where, ' ORDER BY ', v_Sort, ' LIMIT ', v_Offset, ',', v_Limit); -- Nếu lấy dữ liệu trên 1 page có truyền Limit, Offset vào thì sẽ lấy số lượng bản ghi tương ứng trên page
  END IF;

  -- Có thể để ý thấy trên yêu cầu đề bài sẽ không chỉ lấy ra thông tin nhân viên trên page mà còn lấy ra tổng số bản ghi trên toàn bộ các page
  -- Vậy nên có thể hiểu là dữ liệu mong muốn trả về trong store này là 2 dữ liệu: Thông tin nhân viên + Tổng số bản ghi
  -- => Sử dụng phương pháp execute query để trả về 2 thông tin trong cùng 1 store
  PREPARE stmt1 FROM @filterQuery;
  EXECUTE stmt1;
  DEALLOCATE PREPARE stmt1;

  SET @filterQuery = CONCAT('SELECT count(EmployeeID) AS TotalCount FROM `employee` WHERE ', v_Where);
  PREPARE stmt1 FROM @filterQuery;
  EXECUTE stmt1;
  DEALLOCATE PREPARE stmt1;

END
$$

